import React from "react";

const Footer = () => {
  return (
    <footer
      className="footer"
      style={{
        textAlign: "center",
        padding: "1rem",
        background: "#222",
        color: "#fff",
      }}
    >
      <p>&copy; 2024 React Slider Showcase. All rights reserved.</p>
    </footer>
  );
};

export default Footer;
